import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Nav from './Nav';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.min.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const nav = ReactDOM.createRoot(document.getElementById('navegacion'));
root.render(
  <React.StrictMode>
    <Nav />
  </React.StrictMode>
);
reportWebVitals();
